// 'Yes' if the file's name is valid, and 'No' otherwise.
// A file's name is considered to be valid if and only if all the following conditions
// are met:
// - There should not be more than three digits ('0'-'9') in the file's name.
// - The file's name contains exactly one dot '.'
// - The substring before the dot should not be empty, and it starts with a letter from
// the latin alphabet ('a'-'z' and 'A'-'Z').
// - The substring after the dot should be one of these: ['txt', 'exe', 'dll']
func FileNameCheck(file_name string) string {
	// Rule 2: The file's name contains exactly one dot '.'
	dotCount := strings.Count(file_name, ".")
	if dotCount != 1 {
		return "No"
	}

	parts := strings.SplitN(file_name, ".", 2)
	beforeDot := parts[0]
	afterDot := parts[1] // This is the file extension

	// Rule 3: The substring before the dot should not be empty.
	if len(beforeDot) == 0 {
		return "No"
	}

	// Rule 3: The substring before the dot starts with a letter from the latin alphabet.
	firstChar := rune(beforeDot[0])
	if !((firstChar >= 'a' && firstChar <= 'z') || (firstChar >= 'A' && firstChar <= 'Z')) {
		return "No"
	}

	// Rule 4: The substring after the dot should be one of these: ['txt', 'exe', 'dll'].
	validExtensions := map[string]bool{
		"txt": true,
		"exe": true,
		"dll": true,
	}
	if !validExtensions[afterDot] {
		return "No"
	}

	// Rule 1: There should not be more than three digits ('0'-'9') in the file's name.
	digitCount := 0
	for _, r := range file_name {
		if r >= '0' && r <= '9' {
			digitCount++
		}
	}
	if digitCount > 3 {
		return "No"
	}

	// If all conditions are met, the file name is valid.
	return "Yes"
}

